import React from 'react';

const UsuarioSaida = (props) => {
  return (
    <div>
      <p>Nome de Usuário via Props: {props.username}</p>
      <p>Nome de Usuário em Tempo Real: {props.typedUsername}</p>
    </div>
  );
};

export default UsuarioSaida;
